import React, { useState } from "react";
import { useParams } from "react-router-dom";
import "./style.css";

const GroupDetail = ({ groups }) => {
  const { id } = useParams();
  const group = groups.find((group) => group.id === id);

  const [showEditModal, setShowEditModal] = useState(false);
  const [showDeleteModal, setShowDeleteModal] = useState(false);
  const [password, setPassword] = useState("");

  const handleLike = () => {
    console.log("공감 보내기");
  };

  const handleEditGroup = () => {
    console.log("그룹 정보 수정");
  };

  const handleDeleteGroup = () => {
    console.log("그룹 삭제");
  };

  if (!group) {
    return <p>그룹을 찾을 수 없습니다.</p>;
  }

  return (
    <div className="group-detail-container">
      <div className="group-detail-header">
        <div className="group-image-container">
          <img src={group.image} alt={group.title} className="group-image" />
        </div>
        <div className="group-info-container">
          <div className="group-info">
            <p className="group-dday">D+{group.daysSinceCreation}</p>
            <p className="group-visibility">
              {group.isPublic ? "공개" : "비공개"}
            </p>
            <h1 className="group-title">{group.title}</h1>
            <p className="group-description">{group.description}</p>
            <div className="group-stats">
              <span>추억 {group.memoriesCount}</span>
              <span>그룹 공감 {group.likes}K</span>
            </div>
            <div className="group-badges">
              {group.badges.map((badge, index) => (
                <span key={index} className="group-badge">
                  {badge}
                </span>
              ))}
            </div>
          </div>
          <div className="group-actions">
            <button onClick={() => setShowEditModal(true)}>
              그룹 정보 수정하기
            </button>
            <button onClick={() => setShowDeleteModal(true)}>
              그룹 삭제하기
            </button>
            <button onClick={handleLike} className="like-button">
              공감 보내기
            </button>
          </div>
        </div>
      </div>

      {showEditModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>그룹 정보 수정</h2>
            <input
              type="password"
              placeholder="비밀번호 입력"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <button onClick={handleEditGroup}>수정하기</button>
            <button onClick={() => setShowEditModal(false)}>취소</button>
          </div>
        </div>
      )}

      {showDeleteModal && (
        <div className="modal">
          <div className="modal-content">
            <h2>그룹 삭제</h2>
            <input
              type="password"
              placeholder="비밀번호 입력"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <button onClick={handleDeleteGroup}>삭제하기</button>
            <button onClick={() => setShowDeleteModal(false)}>취소</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default GroupDetail;
